import React from 'react'
import Cell from './Cell'

export default ({gridData, updateCell}) => {

    const makecells = gridData.map(cell => <Cell key={cell.position} {...cell} updateCell={updateCell} />)

    return (
        <>
            <div 
                id='grid' 
                className='grid'
                style={{
                    display: 'grid',
                    gridTemplateColumns: 'repeat(30, 2rem)',
                    gridTemplateRows: 'repeat(30, 2rem)',

                }}
            >
                {makecells}
            </div>
        </>
    )
}
